Cair uma vez é acidente, pode acontecer com qualquer um, mas logo depois sobe e vida que segue normalmente, tipo corinthians e internacional.

Agora cair dez vezes não é acidente, é sinal de que o time de fato não tem mais nível de série A e sim de série B, o time deixou de ser grande e agora é pequeno, tipo vasco e cruzeiro.

